pragma solidity ^0.4.24;
pragma experimental ABIEncoderV2;

import "./IERC20Token.sol";

contract ERC20Token is IERC20Token {

    string constant INSUFFICIENT_BALANCE = "Insufficient balance to complete transfer.";
    string constant INSUFFICIENT_ALLOWANCE = "Insufficient allowance to complete transfer.";
    string constant OVERFLOW = "Transfer would result in an overflow.";

    mapping (address => uint256) balances;
    mapping (address => mapping (address => uint256)) allowed;

    uint256 public totalSupply;

    function transfer(address _to, uint256 _value)
        public
        returns (bool)
    {
        require(
            balances[msg.sender] >= _value,
            INSUFFICIENT_BALANCE
        );
        require(
            balances[_to] + _value >= balances[_to],
            OVERFLOW
        );
        balances[msg.sender] -= _value;
        balances[_to] += _value;
        emit Transfer(msg.sender, _to, _value);
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value)
        public
        returns (bool)
    {
        require(
            balances[_from] >= _value,
            INSUFFICIENT_BALANCE
        );
        require(
            allowed[_from][msg.sender] >= _value,
            INSUFFICIENT_ALLOWANCE
        );
        require(
            balances[_to] + _value >= balances[_to],
            OVERFLOW
        );
        balances[_to] += _value;
        balances[_from] -= _value;
        allowed[_from][msg.sender] -= _value;
        emit Transfer(_from, _to, _value);
        return true;
    }

    function approve(address _spender, uint256 _value)
        public
        returns (bool)
    {
        allowed[msg.sender][_spender] = _value;
        emit Approval(msg.sender, _spender, _value);
        return true;
    }

    function balanceOf(address _owner)
        public view
        returns (uint256)
    {
        return balances[_owner];
    }

    function allowance(address _owner, address _spender)
        public
        view
        returns (uint256)
    {
        return allowed[_owner][_spender];
    }
}

